import React from "react";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";

import "bootstrap/dist/css/bootstrap.min.css";

const Header = () => {
  return (
    <navbar collapseonselect expand="lg" bg="dark" variant="dark">
      <navbar.brand>tester</navbar.brand>
      <navbar.toggle aria-controls="responsive-navbar-nav">
        <navbar.collapse id="responsive-navbar-nav">
          <nav classname="mr-auto">
            <nav.link href="#features">Home</nav.link>
            <nav.link href="#pricing">Add question</nav.link>
            <navdropdown
              title="Choose difficulity"
              id="collasible-nav-dropdown"
            >
              <navdropdown.item href="#action/3.1">Easy</navdropdown.item>
              <navdropdown.item href="#action/3.2">Normal</navdropdown.item>
              <navdropdown.item href="#action/3.3">Hard</navdropdown.item>
            </navdropdown>
            <nav.link href="#history">History</nav.link>
          </nav>
        </navbar.collapse>
      </navbar.toggle>
    </navbar>
  );
};

export default Header;
